import React from "react";

function Tabs({ setFilter }) {
  return (
    <div className="tabs">
      <button onClick={() => setFilter("all")}>すべて</button>
      <button onClick={() => setFilter("incomplete")}>未完了</button>
      <button onClick={() => setFilter("completed")}>完了済み</button>
    </div>
  );
}

export default Tabs;
